                },
            ]          
        };
    }



    render() {
        const Shivam =this.state.posts;


            return(
                <div>
                    <h1 id="user-heading">Products details</h1>
                    <div id="product">
                    <ol className="item">
                    {
                        Shivam.map(post => (
                            <li key={post.userId} align="start">
                                <div>
                                    <p className="title">{post.title}</p>
                                    <p className="body">{post.body}</p>
                                    <div class="btn btn-primary"> Apply coupon</div>
                                </div>
                            </li>
                        ))
                    }
                    </ol>
                    </div>
                </div>
            );
        }

    }





export default Users;
